// }

//Class component
//More functionality
//More stuff
//User lifecycle function
class index extends React.Component {
    
    render(){
        return(
            <div>
                <h1>I am Index page</h1>
                <Header title={'I am a header component'}>
                <h1>I am header subtitle</h1>
                </Header>
            </div>
        )
    }
}

export default index;
